  return (
    <select className="btn-sel">
      <option value="small">Small House</option>
      <option value="middle" selected>
        Middle House
      </option>
      <option value="big">Big House</option>
    </select>
  );
};

const mapDispatchToProps = () => {
  return typeOfHouse;
};

export default connect(
  null,
  mapDispatchToProps
)(ButtonToSelect);
